   "source": [
    "> Taking the plots above and Pearson's Correlation Tests into account, we may notice that the time spent in sedentary activity has a **strong negative correlation with the amount of sleep** a user gets a day. On the other hand, we see a **weak negative correlation** between the number of sedentary minutes and **the time taken to sleep**."
   ]
