   "source": [
    "#### 4.1.3 How active need a user be to burn more calories? Does a higher proportion of very active minutes translate into more calories burned? Or light active minutes are enough to achieve the same results?\n",
    "\n",
    "1. Compare the active minutes proportion of each intensity with the amount of calories burned, for example, does a higher proportion of very active minutes translate into higher amount of calories burned? Or high amount of light active minutes play a more important role in calories burned? "
