   "source": [
    "> Looking at the test results above, we may notice that all three categories of active minutes positively correlate with the number of calories burned. However, only the very active minutes seem to have a strong relationship.\n",
    ">\n",
    "> To better understand how the intensity of the active minutes might affect the `Calories` variable, I decided to take the proportion of each level of active minutes. First, I will compute the total active minutes, and then, I will divide each category by this total. I'm leaving out the minutes spent in sedentary activity and time in bed, for they usually comprise more than half of a day, which makes active minutes look insignificant to the overall daily activities."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 35,
   "id": "1e21504a",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-04-25T01:28:14.338334Z",
     "iopub.status.busy": "2023-04-25T01:28:14.336704Z",
     "iopub.status.idle": "2023-04-25T01:28:14.371966Z",
     "shell.execute_reply": "2023-04-25T01:28:14.369724Z"
    },
    "papermill": {
     "duration": 0.068709,
     "end_time": "2023-04-25T01:28:14.374109",
     "exception": false,
     "start_time": "2023-04-25T01:28:14.305400",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Get the total active minutes into a column\n",
    "daily_combined$ActiveMinutes <- daily_combined$LightlyActiveMinutes +\n",
    "                                daily_combined$FairlyActiveMinutes +\n",
    "                                daily_combined$VeryActiveMinutes\n",
    "\n",
    "# Get the proportion in % of Very Active Minutes to the total of Active Minutes\n",
    "daily_combined$PropVeryActive <- round(((daily_combined$VeryActiveMinutes / \n",
    "                                         daily_combined$ActiveMinutes) * 100), digits = 2)\n",
    "\n",
    "# Get the proportion in % of Fairly Active Minutes to the total of Active Minutes\n",
    "daily_combined$PropFairlyActive <- round(((daily_combined$FairlyActiveMinutes / \n",
    "                                           daily_combined$ActiveMinutes) * 100), digits = 2)\n",
    "\n",
    "# Get the proportion in % of Lightly Active Minutes to the total of Active Minutes\n",
    "daily_combined$PropLightlyActive <- round(((daily_combined$LightlyActiveMinutes / \n",
